import React, { Fragment, useEffect } from "react";


const ListStatistic = () => {
  const [count, setOrderStatistic] = useState([]);


  const getOrder = async () => {
    try {
      const response = await fetch("http://localhost:4000/orders/statistic");
      const jsonData = await response.json();

      setOrderStatistic(jsonData);
    } catch (err) {
      console.error(err.message);
    }
  };

  useEffect(() => {
    getOrder();
  }, []);

  console.log(count);

  return (
    <Fragment>
      {" "}
      <table class="table mt-5 text-center">
        <thead>
          <tr>
            <th>Id</th>
            <th>Created at</th>
            <th>Name</th>
            <th>Phone</th>
          </tr>
        </thead>
        <tbody>
          {/*<tr>
            <td>John</td>
            <td>Doe</td>
            <td>john@example.com</td>
          </tr> */}
          {count.map(todo => (
            <tr>
              <td>{todo.count}</td>

            </tr>
          ))}
        </tbody>
      </table>
    </Fragment>
  );
};

export default ListStatistic;
